--
-- Table structure for table `product`
--

DROP TABLE IF EXISTS `product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `product` (
  `product_id` varchar(36) NOT NULL DEFAULT (uuid()),
  `product_code` varchar(20) NOT NULL,
  `product_name` varchar(150) NOT NULL,
  `description` text,
  `category_id` varchar(36) NOT NULL,
  `collection` varchar(100) NOT NULL,
  `material` varchar(100) DEFAULT NULL,
  `season` enum('Spring','Summer','Autumn','Winter','All_Season') DEFAULT NULL,
  `care_instructions` varchar(255) DEFAULT NULL,
  `image` varchar(255) DEFAULT NULL,
  `price` decimal(38,2) NOT NULL,
  `stock_quantity` int DEFAULT '0',
  `size` json DEFAULT NULL,
  `rating` float DEFAULT NULL,
  `tags` varchar(255) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `colors` json NOT NULL,
  PRIMARY KEY (`product_id`),
  UNIQUE KEY `product_code` (`product_code`),
  KEY `category_id` (`category_id`),
  CONSTRAINT `product_ibfk_1` FOREIGN KEY (`category_id`) REFERENCES `category` (`category_id`),
  CONSTRAINT `product_chk_1` CHECK ((`price` >= 0)),
  CONSTRAINT `product_chk_2` CHECK ((`stock_quantity` >= 0))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

