DROP TABLE IF EXISTS `product_review`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `product_review` (
  `review_id` varchar(36) NOT NULL DEFAULT (uuid()),
  `product_id` varchar(36) NOT NULL,
  `user_id` varchar(36) NOT NULL,
  `rating` int NOT NULL,
  `title` varchar(150) DEFAULT NULL,
  `comment` text NOT NULL,
  `images` json DEFAULT NULL,
  `status` enum('Pending','Approved','Rejected','Flagged') NOT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `variant_id` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`review_id`),
  KEY `idx_pr_product_status_created` (`product_id`,`status`,`created_at`),
  KEY `idx_pr_user` (`user_id`),
  KEY `FK2s71vu2bbru94xiavn4oqehse` (`variant_id`),
  CONSTRAINT `FK2s71vu2bbru94xiavn4oqehse` FOREIGN KEY (`variant_id`) REFERENCES `product_variant` (`variant_id`),
  CONSTRAINT `product_review_ibfk_1` FOREIGN KEY (`product_id`) REFERENCES `product` (`product_id`),
  CONSTRAINT `product_review_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `customer` (`customer_id`),
  CONSTRAINT `product_review_chk_1` CHECK ((`rating` between 1 and 5)),
  CONSTRAINT `product_review_chk_2` CHECK ((length(`comment`) between 12 and 500))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

